    @RequestMapping(value = "/clean_report/uploads", method = RequestMethod.POST)
    public String create(MultipartFile multipartFile) throws IOException  {
        /* "download_url": "http://47.92.192.154:9077/iclean-cloud/data/download/map?device_id=51&uuid=56ac753a-b634-42b9-85c0-6e4a4061db6b",
                "path": "http://47.92.192.154:9993/data/map/51/56ac753a-b634-42b9-85c0-6e4a4061db6b/map.png",*/

        /*步骤：
        * 1.通过multipartFile获取文件名
        * 2.获取文件流*/
        String filename = multipartFile.getOriginalFilename();
        byte[] bytes = multipartFile.getBytes();
        BASE64Encoder encoder = new sun.misc.BASE64Encoder();

        String encode = encoder.encode(bytes);
        System.out.println("bytes:  "+bytes);
        System.out.println("filename:  "+filename);
        System.out.println("encode:  "+encode);
        return null;
    }

    @PostMapping("/clean_report/upload_path_files")
    public String savePicByIo(HttpServletRequest request) throws Exception{
        /*"http://47.92.192.154:9993/data/map/48/394d6eeb-f387-403e-838c-7a129445faa3/map.png",*/
        /*{"successed":true,"msg":"","errorCode":"","data":{"file_name":"5fda868b-fec2-4fa7-86b9-6f04c10032fd"}}*/
        //path=map/device_id/uuid/map.png
//        System.out.println("图片上传开始");
            /*连接ftp服务*/
        FTPClient ftpClient=new FTPClient();
        // 设置PassiveMode传输
        ftpClient.enterLocalPassiveMode();
        //设置二进制传输，使用BINARY_FILE_TYPE，ASC容易造成文件损坏
        ftpClient.setFileType(FTPClient.BINARY_FILE_TYPE);
        // 设置连接超时时间,5000毫秒
        ftpClient.setConnectTimeout(50000);
        // 设置中文编码集，防止中文乱码
        ftpClient.setControlEncoding("UTF-8");
        ftpClient.connect(Constants.FtpServer.FTP_SERVER_IP.getValue(), Integer.parseInt(Constants.FtpServer.FTP_SERVER_PORT.getValue()));
        ftpClient.login(Constants.FtpServer.FTP_SERVER_USERNAME.getValue(),Constants.FtpServer.FTP_SERVER_PASWWORD.getValue());
        /*获取设备发送过来的地图流*/
        ServletInputStream inputStream = request.getInputStream();
        /*组装存放地图路径：
        * 1.指定一个存放地图的文件/data/map
        * 2.子目录为地图对应的设备device_id+指定格式的随机数，随机数防止同一设备时发生冲突
        * 3.图片名统一为map.png
        * */
//        String uuid=UUID.randomUUID().toString();
        String fileName = "/map/"+ UUID.randomUUID().toString();
        String path="map"+".png";
        System.out.println("path： "+path);
        boolean storeFile = ftpClient.storeFile(path, inputStream);

        if(storeFile==true){
            System.out.println("成功： "+fileName);
        }

        return "";
    }

